import React from "react";
import "./book.css";
import { useSelector, useDispatch } from "react-redux";
import { decrement, increment } from "../../redux/authorsSlice";
function Book() {
  const count = useSelector((state) => state.book.value);
  console.log("count");
  console.log(count);
  console.log("count");
  return <div className="book-wrapper">Hello Bookgg</div>;
}

export default Book;
